import './App.css';
import './Lab1EmptyList.css';
import LineList from './LineList.js';
function App(props) {
  return (
      <div id="container">
        <div id="button-div"><button class="back-button">&larr;</button></div>
        <div id="title"><h2>TITLE OF LIST</h2></div>
          <LineList listData = {props.initialData}/>
      </div>
  );
}

export default App;
